        var servers = [];
        var server = this.default

        var players = [];
        server.clients.forEach((client) => {
            players.push(client)
        })
        var defaul = {
            config: server.getConfig(),
            id: server.id,
            name: server.name,
            scname: server.scname,
            selected: server.selected,
            players: players
        };

        server.dataService.config = null;
        this.default = false;
        this.removeServer(1, true)

